import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LoginPage from './components/Loginpage';
import Header from './components/Header';
import Footer from './components/Footer';
import HomePage from './components/HomePage';
import { AuthProvider } from './components/AuthContext'; // Adjust the import path if needed
import 'bootstrap/dist/css/bootstrap.min.css';
import Search from './components/search/Search';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div>
          <Header />
          <div><br/></div>
          <Routes>
            <Route path="/" element={<ProtectedRoute><LoginPage /></ProtectedRoute>} />
            <Route path="/home" element={<ProtectedRoute><HomePage /></ProtectedRoute>} />
            <Route path="/search" element={<ProtectedRoute><Search /></ProtectedRoute>} />
            <Route path="*" element={<Navigate to="/" />} />
          </Routes>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

function ProtectedRoute({ children }) {
  const { isLoggedIn } = React.useContext(AuthContext); // Ensure AuthContext is correctly imported and used
  console.log("is logged ->", isLoggedIn);
  return isLoggedIn ? children : <Navigate to="/" />;
}

export default App;
